import { useNavigate, Link } from "react-router-dom";
import { Input,Button, Checkbox} from '@material-tailwind/react';
import { auth } from '../firebase-config';
import { signInWithEmailAndPassword } from 'firebase/auth';
import CopyrightText from '../Components/CopyrightText';

function LoginPage() {
  const navigate = useNavigate();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = (e) => {
    e.preventDefault();

    signInWithEmailAndPassword(auth, email, password)
      .then((userCredential) => {
        console.log(userCredential);
        navigate("/Home");
      })
      .catch((error) => {
        console.error('Erreur de connexion: ', error.message);
        alert('erreur :' + error.message);
      });
  };

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col justify-center">
      <div className="max-w-md w-full mx-auto p-8">
        <div className="text-center">
          <img className="mx-auto w-14 h-14 mb-4" src="/logo.png" alt="Logo de l'application" />
        </div>
        <form className="mt-8" onSubmit={handleLogin}>
        <div className="w-full mb-8">
              <Input label="Votre login" icon={<i className="material-icons">person</i>} placeholder=" "
              color="gray"
              value={email}
              onChange={(e) => setEmail(e.target.value)} />
        </div>

<div class="w-full" >
  <div class="relative w-full min-w-[200px] h-10">
    <div class="absolute grid w-5 h-5 place-items-center text-blue-gray-500 top-2/4 right-3 -translate-y-2/4">
      <i class="fas fa-heart" aria-hidden="true"></i>
    </div>
    <div className="absolute grid w-5 h-5 place-items-center text-blue-gray-500 top-2/4 right-3 -translate-y-2/4">
              <i className="material-icons">lock</i>
            </div>
